%COLON_TISSUES Datafile with Nap/Postma colon slide 1024x1024 patches
%
% A = COLON_TISSUES
%
% A is a datafile with 31922 rgb patches of size 1024*1024 taken from
% 46 different slides. The slides are labeled in 4 classes:
% G1 - normal      (11 slides)
% G2 - inflamed    (11 slides)
% G3 - adenomatous (14 slides)
% G4 - tumor       (10 slides)
% The patches are labeled in 7 classes:
%  1 - G1 (6134 patches)
%  2 - G2 (2976 patches)
%  3 - G3 (2261 patches)
%  4 - G4 (2503 patches)
%  5 - unknown (4061 patches)
%  6 - inappropriate for labeling (3150 patches)
%  7 - discarded from labeling (10837 patches)
%
% In the datafile the patches are labeled by 3 different labeling systems: 
% 'slideclass' - This labels the patches by the slide labels G1-G4.
%                All patches of the same slide have this slide label.
% 'slide'      - All patches of the same slide are given the corresponding
%                slidenumber
% 'patchclass' - The above explained patch labels 1-7. 
% By the CHANGELABLIST command labeling systems can be switched. See 
% MULTI_LABELING for information on this system.
%
% EXAMPLE Show some of the type 1 and type 4 patches from the G4 slides:
% a = colon_tissues;                  % get the datafile
% b = seldat(a,'G4');                % extract class G4
% b = changelablist(b,'patchclass'); % switch the 'patchclass' labeling
% c = seldat(b,[2 5]);               % extract the patches of types 1 and 4
% d = gendat(c,[15 15]);             % generate 15 patches per type
% figure; show(seldat(d,1),3);
% figure; show(seldat(d,2),3); 
% showfigs
% 
% SEE ALSO
% DATAFILES

function a = colon_tissues

dirname = fileparts(which(mfilename));

% if saved datafile exist, take it
if exist(fullfile(fullfile(dirname,'colon_tissues'),'colon_tissues.mat'),'file')
	a = prdatafile(fullfile(dirname,mfilename));
else % creation needed
	% first a datafile with the given slide classes in subdirs is created
	a = prdatafile(fullfile(dirname,mfilename));
	% for the patch labels we need an adapted version of Postma's READLABELS
	[slidename,patchclass] = readlabels(a);
	% add two labelings
	a = addlabels(a,slidename,'slide');
	tab = [7 1:6]';
	a = addlabels(a,tab(patchclass+1),'patchclass');
	% the following magic renames 'default' labeling into 'slideclass'
	alablist = a.lablist;
	lablistnames = alablist{4,1};
	lablistnames(1,:) = 'slideclass';
	alablist{4,1} = lablistnames;
	a.lablist = alablist;
	% save matfile
	a = changelablist(a,'slideclass');
	save(fullfile(fullfile(dirname,'colon_tissues'),'colon_tissues.mat'),'a');
end

%READLABELS This version is adapted from the one written by Eric Postma
% in order to enable a PRTools datafile construct.

function [slidename,patchclass] = readlabels(a)

S = importlabels; % returns a cell array

% we search for elements of the array with '.tif'

patch = cell(length(S),1);
slide = cell(length(S),1);
%slideline = cell(length(S),1);
patchlab = zeros(length(S),1);
slidelab = zeros(length(S),1);
[n,s,count] = prwaitbarinit('Processing %i filenames:',length(S));
k = 0;
for i=1:length(S)
	count = prwaitbarnext(n,s,count);
  res1 = findstr('.tif',S{i,1});
  if ~isempty(res1) 
    % disp(S{i,1}), drawnow;
    res2=findstr('\T0',S{i,1});
		if isempty(res2) 
			disp(['ERROR!!!']); 
		end
    string = S{i,1};
    string = string(res2(length(res2))-3:end);
    if strcmp(string(end-3:end),'.tif') & strfind(S{i,1},'_p') 
			k = k+1;
			% find slide labels
			%slideline{k} = S{i,1};
			res3 = findstr('beelden',S{i,1});
			spart = S{i,1}(res3+7:res3+10);
			if strcmp(spart,'\G1\')
        slideclass = 1;
      elseif strcmp(spart,'\G2\')
        slideclass = 2;
      elseif strcmp(spart,'\G3\')
        slideclass = 3;     
      elseif strcmp(spart,'\G4\')
        slideclass = 4;
			else
				disp(['Error in ' S{i,1}])
			end
			slidelab(k,1) = slideclass;
			
		  % find patch labels
      if strcmp(string(1:4),'\G1\')
        labelindex = 1;
      elseif strcmp(string(1:4),'\G2\')
        labelindex = 2;
      elseif strcmp(string(1:4),'\G3\')
        labelindex = 3;     
      elseif strcmp(string(1:4),'\G4\')
        labelindex = 4;
      elseif strcmp(string(1:4),'own\')
        labelindex = 5;
      else
        labelindex = 6;
      end;
			patchlab(k,1) = labelindex;
			% store patch image name and slide number
			patch{k} = string(5:end);
			slide{k} = string(5:strfind(string,'_p')-1);
      %fprintf(outfile,'%s %d\n',string(5:end), labelindex);
    end;
  end;
end;

prwaitbar(0)
patchlab(k+1:end,:) = [];
patch(k+1:end) = [];
slide(k+1:end) = [];

% find the patches in the given datafile a
ind = getident(a,'file_index');
files = getfiles(a);
files = files{2};
m = size(a,1);

slidename  = cell(m,1);
patchclass = zeros(m,1);

[n,s,count] = prwaitbarinit('Finding labels for %i patches:',m);
patch = char(patch);

% we have png images in the datafile and labels are give for tif images
% let us delete extensions
for j=1:size(patch,1)
	nn = strfind(patch(j,:),'.tif'); 
	patch(j,nn:nn+3) = '    '; 
end

for i=1:size(ind,1)
	count = prwaitbarnext(n,s,count);
	file_i = files{ind(i,1)}(ind(i,2),:);
	nn = strfind(file_i,'.png'); % delete extension
	file_i(nn:nn+3) = '    '; 
	k = strmatch(file_i,patch);
	if ~isempty(k)
	   patchclass(i) = patchlab(k);
		 slidename{i}  = slide{k};
		 patchlab(k) = 0;
	else
		j = strfind(file_i,'_p');
 		slidename{i} = file_i(1:j-1);
  end
end
prwaitbar(0);

